    const [clientes, setClientes] = useState();
    console.log(clientes);

    useEffect(async ()=>{
        const response = await axios.get(
            'http://localhost:8080/'
        );
        setClientes(response.data);
        
    },[]);
    return (
        <div>
            {/* ,ul<h1>TESTE</h1> */}
            <ul>
                {clientes.map((cliente) => {
                    <li>{cliente.nome}</li>
                })}
            </ul>
        </div>
    );
};
    
export default Index;
